import './App.css';

import {
    Route,
    BrowserRouter as Router,
    Routes
} from "react-router-dom";

import Login from './pages/Login';

//toast config
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

function App() {
    return (
        <Router>
            <ToastContainer />
            <Routes>
                <Route path='/login' element={<Login />} />
            </Routes>
        </Router>
    )
}
export default App;
